import React from "react";
import "../CSS/History.css";
function History() {
    const addItem = async () => {
        const raw = {
            id: 1,
            autosize: true,
            height: "100%",
            width: "100%",
            symbol: "NASDAQ:AAPL",
            timezone: "America/New_York",
            theme: "dark",
            style: "1",
            locale: "en",
            toolbar_bg: "#f1f3f6",
            enable_publishing: false,
            withdateranges: true,
            range: "1D",
            hide_side_toolbar: false,
            allow_symbol_change: true,
            watchlist: ["NASDAQ:AAPL"],
            hotlist: true,
            calendar: true,
            show_popup_button: true,
            studies: ["RSI@tv-basicstudies"],
        };

        const requestOptions = {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(raw),
        };

        await fetch(" http://localhost:8000/chart", requestOptions);
    };
    return (
        <div className="HistoryPage">
            <input className="date-history" placeholder="Date" />
            <input className="symbol-history" placeholder="Ticker" />
            <input className="buy-history" placeholder="Buy Price" />
            <input className="sell-history" placeholder="Sell Prsice" />
            <input className="shares-history" placeholder="Shares" />
            <input className="time-history" placeholder="Total Time" />
            <textarea className="note-history" placeholder="Enter Note...." />
            <button className="submit-history">Submit</button>
        </div>
    );
}

export default History;
